import React from "react";
import "./About.css";

function About() {
  return (
    <div>
      <header classname="first-head">
        <div id="container">
          <div id="Professional">
            <h1>Professional Experience</h1>
          </div>
          <div id="Proficiencies">
            <h1>Skills</h1>
          </div>
          <div id="Non-Technical">
            {" "}
            <h1>Non-Technical Experience</h1>{" "}
          </div>
          <div id="Passions">
            <h1>Passions</h1>
          </div>
        </div>
      </header>
    </div>
  );
}

export default About;
